import path from 'path';

export default async function(page, fileUrl, screenshotsDir) {
  try {
    // Navigate to the HTML file
    await page.goto(fileUrl);
    await page.waitForLoadState('networkidle');

    // Take initial screenshot
    const screenshots = [];
    await page.screenshot({ path: path.join(screenshotsDir, 'step_1_initial.png') });
    screenshots.push(path.join(screenshotsDir, 'step_1_initial.png'));

    // Click on the profile button
    await page.waitForSelector('.profile-btn');
    await page.click('.profile-btn');
    await page.waitForLoadState('networkidle');

    // Take screenshot after clicking profile button
    await page.screenshot({ path: path.join(screenshotsDir, 'step_2_profile_clicked.png') });
    screenshots.push(path.join(screenshotsDir, 'step_2_profile_clicked.png'));

    // Click on the "Edit profile" button
    await page.waitForSelector('.edit-profile-btn');
    await page.click('.edit-profile-btn');
    await page.waitForLoadState('networkidle');

    // Take screenshot after clicking edit profile button
    await page.screenshot({ path: path.join(screenshotsDir, 'step_3_edit_profile_clicked.png') });
    screenshots.push(path.join(screenshotsDir, 'step_3_edit_profile_clicked.png'));

    // Verify that the profile editing interface is displayed
    const isEditProfileVisible = await page.isVisible('#profileModal');

    return {
      success: true,
      action: "Profile editing interface verified",
      extractedData: { isEditProfileVisible },
      screenshots,
      error: null
    };
  } catch (error) {
    return {
      success: false,
      action: "Failed to complete task",
      extractedData: {},
      screenshots: [],
      error: error.message
    };
  }
}

